TF1继承于 TNamed, TAttLine, TAttFill, TAttMarkerA TF1 object is a 1-Dim function defined between a lower and upper limit.The function may be a simple function based on a TFormula expression or a precompiled user function.The function may have associated parameters.TF1 graphics function is via the TH1 and TGraph drawing functions.The following types of functions can be created:Expression using variable x and no parameters

Expression using variable x with parameters

Lambda Expression with variable x and parameters

A general C function with parameters

A general C++ function object (functor) with parameters

A member function with parameters of a general C++ class

